Redescription.
Length = 2.70–3.50 (3.10 ± 0.26, n = 11) mm. Body broadly ovate, moderately convex dorsally, slightly so ventrally: body length/elytral width = 1.31–1.37 (1.34); greatest depth/elytral width = 0.57–0.62 (0.58). Colouration rather variable; most of head, centre of pronotum, most of elytra and posteromesal portion of metaventrite black; posterior portion of head, clypeus, labrum, lateral portions of pronotum with anterior and/or posterior mesal incursions, and lateral elytral margins, as well as most of ventral surfaces and legs yellow to yellowish-brown; scutellar shield either black or yellowish-brown; antennae usually reddish-brown with black club. Dorsal vestiture of very short, fine hairs, barely visible under lower magnifications and often abraded; ventral vestiture of moderately long, fine sparse setae. Head about 0.88× as long as wide. Eyes 0.33× as long as head width. Temples 0.2× as long as eye, curved. Vertexal line absent. Frontoclypeal suture straight, weakly impressed (represented by a transverse shallow depression). Clypeus with sides parallel for most of their lengths, apex truncate. Labrum 0.28× as long as wide, with sides curved; apex broadly rounded with small median incision. Antennal scape 1.50× as long as wide and 1.36× as long as pedicel; antennomere 3 about 1.33× as long as 4; club 1.09× as long as antennomeres 3–8 combined and 1.67× as long as wide; terminal antennomere 0.71× as long as wide. Mandible strongly, abruptly curved at apex, which is obliquely bidentate and dorsally serrate; mola welldeveloped with a number of transverse ridges; prostheca slender and densely setose; base of mola, ventrally with densely setose lobe. Apical maxillary palpomere about 2.0× as long as wide, widest at base with narrowly rounded apex. Mentum 0.54× as long as wide, slightly widened to subapex, then narrowed to 
form paired
rounded lobes on either side of truncate apex; apical labial palpomere 2.0× as long as wide, widest near base with narrowly rounded apex. Genal ridges sinuate and slightly converging, extending to ends of temples; subocular ridges well-developed, also extending to ends of temples; anterior genal process with truncate apex. Anterior half of submentum with a cluster of large, shallow pits. Pronotum 0.34–0.42 (0.37)× as long as wide, widest near base; anterior edge weakly emarginate forming broadly subangulate anterior angles; lateral margins visible for their entire lengths from above; posterior angles more or less right; posterior edge broadly curved but slightly sinuate on each side of scutellar base; disc moderately, evenly convex; punctation moderately fine and sparse, punctures often separated by one to two diameters; interspaces relatively smooth and shiny. Prosternum 0.91× as long as mid length of procoxal cavity, moderately convex mesally, not carinate, with slight depression on each side; prosternal process 0.86× as wide as mid length of procoxal cavity, not curved behind coxae; apex subtruncate with short, vertical wall, capable of abutting anterior edge of metaventrite and concealing mesoventrite in ventral view, but usually separated from metaventrite in dead specimens. Scutellar shield 0.44× as wide as pronotum, broadly angulate at apex; punctation slightly coarser than that on pronotum. Elytra 0.99–1.05 (1.01)× as long as wide and 2.73–3.50 (3.05)× as long as pronotum; lateral margins visible for their entire lengths from above; adsutural lines present in posterior half; apices conjointly rounded, usually exposing part of pygidium; humeri weakly developed; disc moderately convex; adsutural lines ending well before middle; with nine rows of megapunctures which are larger than scutellar punctures and relatively narrowly separated within a row; interstices with scattered micropunctures; surfaces smooth and shiny. Epipleura slightly oblique, not or barely visible in lateral view, broader anteriorly, gradually narrowed posteriorly and extending to posterior edge of abdominal ventrite 3. Anterior edge of mesoventrite on distinctly different plane than metaventrite, with small triangular prosternal rest and short, low median carina; posterior edge vertical and not visible in ventral view, except for a pair of small mesothoracic lobes (
Fig. 51
) visible on either side of truncate anterior process of metaventrite. Mesocoxae separated by 1.11× longest longitudinal diameter of mesocoxal cavity. Metaventrite moderately convex, shortest distance between meso- and metacoxal cavities 0.25× greatest width of ventrite; discrimen absent; axillary spaces relatively small, postcoxal lines arising at about mesal third of coxal cavity and more or less straight, extending almost to lateral edge of ventrite before curving posteriorly; posterior edges of mesocoxal cavities not joined mesally by fine line; anterior process of metaventrite truncate; punctation relatively coarse anterolaterally and along posterior edge of ventrite, but much finer and sparser at middle. Metanepisternum 4.4× as long as wide, widest near anterior end and narrowed posteriorly. Metacoxae separated by 1.25× mid length (shortest diameter) of metacoxa. Protibia expanded, widest and more or less angulate at apical fifth, with six moderately long spines between this point and apex; outer edge finely serrate, each serration bearing a short, stout, blunt spine. Mesotibia and metatibia both similarly expanded and subapically angulate, but with outer edge lined with slender spines. Anterior faces of meso- and metatibiae each with longitudinally oblique setal row. All tarsomeres narrow and subcylindrical dorsally, without expanded lobes, tarsomeres 1–3 with brushes of setae beneath; metatarsus 0.60× as long as metatibia. Abdomen with ventrite 1 at lateral third about equal in length to ventrite 2, with intercoxal process subtruncate at apex and with postcoxal lines broadly, gradually curved, extending to about middle of ventrite and located close to intercoxal process; ventrites 2–4 more or less equal in length, and 5 about 1.5× as long as 4; ventrites 2–4 each with a fine anterior transverse carina and a more prominent transverse carina closer to middle; ventrite 5 with two transverse carinae both near anterior edge and apex broadly rounded in female and distinctly biemarginate in male. Pygidium with straight, transverse basal carina, its apex subtruncate in male and broadly rounded in female. Tergite VIII (anal sclerite) in male apically rounded, not visible beyond pygidial apex. Tegmen (
Fig. 30
) 2.50× as long as wide, sides parallel for basal two-thirds, then converging to subtruncate apex; basal strut 0.4× as long as body of tegmen. Penis (
Fig. 31
) 0.75× as long as tegmen and 2.3× as long as wide, with subtruncate apex; basal penile strut 1.76× as long as body of penis, slightly expanded at tip. Ovipositor (
Fig. 45
) 1.60× as long as wide, more or less flattened; paraprocts 0.84× as long as gonocoxites, which are 1.29× as long as their combined widths, widest at base and gradually narrowing to subacute contiguous apices, without distinct gonostyli, but with small sockets for gonostyli located just at apex and not visible under lower magnifications.
